import React from 'react';
import { ListGroupItem } from 'reactstrap';
import {Link} from 'react-router-dom'
import './CityBox.css'

class CityBox extends React.Component {
    constructor(props) { 
        super(props);
        this.state = {
            city: []
        };
    }

    render() {  
        // 'http://localhost:5000/'
        var asd1 = "";
        if (this.props.city.image) {
            var asd1 = ( process.env.PUBLIC_URL + this.props.city.image.split("\\").join("/"));
        } 
        console.log(asd1);
        return(
            <div className="CityBox">
                <Link to = {{ pathname: "/cities/" + this.props.city._id }} > 
                    <ListGroupItem className="CityBoxList" style={{ backgroundImage: `url(${asd1})`}}>
                        <h5>{this.props.city.name}</h5> {}
                    </ListGroupItem> 
                </Link>
            </div>
        )
    }
}

export default CityBox;
